INSERT INTO `film` (`id`, `Cim`, `Kategoria`, `Mufaj`, `Korhatar`, `Jatekido`, `Gyarto`, `Rendezo`, `Szereplok`, `Leiras`, `EredetiNyelv`, `EredetiCim`, `Szinkron`, `TrailerLink`, `IMDB`, `ImageID`, `Megjegyzes`) VALUES
(1, 'Sonic, a sündisznó 3', '2D', 'Kalandfilm, Vígjáték, Családi, Fantasy', '12', 110, 'Original Film, Marza Animation Planet,  Blur Studio', ' Jeff Fowler', 'Jim Carrey, Ben Schwartz, Krysten Ritter, Natasha Rothwell, Shemar Moore, James Marsden, Tika Sumpter, Idris Elba, Keanu Reeves', 'Sonic, a sündisznó visszatér a mozivászonra karácsonykor az eddigi legizgalmasabb kalandjával. Sonic, Knuckles és Tails összefognak egy veszélyes új ellenféllel, Shadow-val szemben, aki egy rejtélyes gonosztevő, és olyan ereje van, amilyennel még egyiküknek sem volt dolga. És mivel a Sonic csapat képességeit ez a kihívás minden szempontból meghaladja, keresniük kell egy váratlan szövetségest, hogy megállítsák Shadow-t, és megvédjék a bolygót…', 'angol', 'Sonic the Hedgehog 3', 'magyar', 'https://www.youtube.com/watch?v=glg2dVvjnMI', '6.9', 10, ''),
(2, 'Egy Minecraft film', '2D', ' Vígjáték, Családi', '12', 101, 'Warner Bros. Pictures, Legendary Pictures, Mojang Studios, Vertigo Entertainment, On the Roam, Domain Entertainment', 'Jared Hess', 'Jason Momoa, Jack Black, Emma Myers, Danielle Brooks, Jennifer Coolidge', 'Lépj be a Minecraft világába, ahol a kreativitás a minimum – annak, aki életben akar maradni. Négyen vannak: az egyikük a 80-as években volt nagy videójátékos (Jason Momoa), a másik mobilállatkertet üzemeltet (vagyis egy lámát fuvaroz ide-oda az autóján), egy testvérpár (egy fiatal nő és iskolás kisöccse) meg most költözött a városba, és még nem tudja, merre mennyi. Aztán úgy alakul, hogy egy titokzatos átjárón keresztül mindannyian átzuhannak egy izgalmas, kiismerhetetlen és nagyon furcsa másik világba, ahol minden kockákból épül, és csak a képzelet szab neki határt. Ha haza akarnak jutni, akkor rá kell jönniük, mi hogy működik ezen a helyen (és meg kell menekülniük a malac és zombi formájában érkező gonosz lényektől) – ennek érdekében pedig hosszú vándorútra kell indulniuk Steve, a régóta a kockavilágban élő, tapasztalt építőmester (Jack Black) vezetésével. Még szerencse, hogy út közben valamennyien felismernek magukban egy-két addig lappangó képességet, és rájönnek, hogy bennük is pezseg a fantázia: csak hagyni kell szárnyalni.', 'angol', 'A Minecraft Movie', 'magyar', 'https://www.youtube.com/watch?v=ZUqHtdB27uo', '6.1', 27, ''),
(3, 'Paddington Peruban', '2D', ' Vígjáték, Családi', '6', 106, 'StudioCanal, Columbia Pictures, Stage 6 Films, Marmalade Pictures', 'Dougal Wilson', 'Antonio Banderas, Olivia Colman, Hugh Bonneville, Emily Mortimer, Julie Walters', 'Paddingtonnal mindig történik valami. Pedig boldogan és elégedetten él Londonban a Brown család padlásszobájában, ám kap egy levelet, és minden a fejére áll. A levél Peruból érkezik, és arról értesíti a kis medvét, hogy eltűnt imádott nagynénje, aki egy Nyugdíjas Medvék Otthonában éldegélt, és bingózással töltötte öreg napjait. Paddington nem habozik, és azonnal Peruba indul, hogy felkutassa Lucy nénit. A Brown család habozik, de azért vele megy. Kalandos, veszélyes és fordulatos útjuk során átvágnak a dzsungelen, hajótörést szenvednek, felkutatják Eldorádót, az elveszett aranyvárost, megküzdenek egy kóros aranylázban szenvedő kalandorral (Antonio Banderas), és végül szembesülnek egy olyan nagy titokkal, ami Paddington egész addigi életét megváltoztathatja…', 'angol', 'Paddington in Peru', 'magyar', 'https://www.youtube.com/watch?v=W6el2dl04BE', '6.5', 26, ''),
(4, 'Oppenheimer', '2D', ' Életrajzi, Dráma', '16', 181, '	 Universal Pictures, Syncopy Inc., Atlas Entertainment, Gadget Films, Breakheart Films, Peters Creek Entertainment', ' Christopher Nolan', 'Cillian Murphy, Emily Blunt, Matt Damon, Robert Downey, Jr., Florence Pugh, Benny Safdie, Michael Angarano, Josh Hartnett', 'A Christopher Nolan által írt és rendezett Oppenheimer egy IMAX-re forgatott nagyszabású thriller.  Berepíti a nézőt abba az izgalmas paradoxonba, amit az a rejtélyes férfi élt át, aki megkockáztatta, hogy elpusztítja a világot, azért, hogy megmentse azt. A főszereplők Cillian Murphy mint J. Robert Oppenheimer, és Emily Blunt mint a felesége, a biológus és botanikus Katherine “Kitty” Oppenheimer. Az Oscar-díjas Matt Damon alakítja Leslie Groves Jr. tábornokot, a Manhattan-terv igazgatóját, és Robert Downey, Jr. alakítja Lewis Strausst, az Amerikai Atomenergia Bizottság alapító biztosát. Az Oscar-jelölt Florence Pugh játssza Jean Tatlock pszichiátert, Benny Safdie Teller Ede elméleti fizikust, Michael Angarano Robert Serbert, valamint Josh Hartnett alakítja az úttörő amerikai atomtudóst, Ernest Lawrence-et. A szereplők közt találjuk még az Oscar-díjas Rami Malekot, és a rendező ismét együtt dolgozik a nyolcszoros Oscar-jelölt színésszel, íróval és rendezővel, Kenneth Branagh-gel. A film Kai Bird és a néhai Martin J. Sherwin Pulitzer-díjas könyve, az Amerikai Prométheus: J. Robert Oppenheimer diadala és tragédiája alapján készült. A producerek Emma Thomas, Charles Roven és Christopher Nolan. Nolan filmjei, köztük a Tenet, a Dunkirk, a Csillagok között, az Eredet és a Sötét Lovag-trilógia több mint ötmilliárd dollár bevételt hoztak világszerte, 11 Oscar-díjat és 36 jelölést gyűjtöttek be, köztük két a legjobb filmnek járó jelölést.', 'angol', 'Oppenheimer', 'magyar', 'https://www.youtube.com/watch?v=1mR3r0JkJDI', '8.3', 35, ''),
(5, 'Barbie', '2D', ' Vígjáték, Fantasy', '12', 115, 'Heyday Films, LuckyChap Entertainment, NB/GG Pictures, Mattel Films', 'Greta Gerwig', 'Margot Robbie, Ryan Gosling, America Ferrara, Kate McKinnon, Michael Cera, Will Ferrell', 'Van ám olyan világ, ahol minden csodálatos! Mindig süt a nap, lenn a parton mindig lágyan hullámzik a tenger, és szörfdeszkákon, a nyugágyakban meg a bulizósabb helyeken sokféle, de mindig gyönyörű strandoló gyűlik össze: Barbie (Margot Robbie) és Ken (Ryan Gosling) meg a többi Barbie és Ken. De még legtökéletesebb, legrózsaszínebb, legszerelmesebb helyen is történhetnek bajok. Szerencsére Barbie nemcsak szép, hanem talpraesett is. Ha kell, még a valóságos világba is elmegy, hogy megvédje a maga különleges országát. És persze sosincs egyedül. Lehet, hogy Ken nem olyan éles eszű, vagy nem akkora vagány, mint ő, de van egy nagyon fontos tulajdonsága: mindig kiáll az ő Barbie-jáért, és sosem hagyja cserben.', 'angol', 'Barbie', 'magyar', 'https://www.youtube.com/watch?v=S7qsTilxELA', '6.8', 36, '');
