INSERT INTO `httplogs` (`Id`, `Schema`, `Host`, `Path`, `QueryString`, `RequestHeaders`, `RequestBody`, `ResponseHeaders`, `ResponseBody`, `StatusCode`, `LogTime`) VALUES
(203, 'https', 'localhost:7153', '/api/Film/add', '', 'Accept: application/json, text/plain, */*\nHost: localhost:7153\nUser-Agent: Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/135.0.0.0 Safari/537.36\nAccept-Encoding: gzip, deflate, br, zstd\nAccept-Language: en-GB,en-US;q=0.9,en;q=0.8\nContent-Type: multipart/form-data; boundary=----WebKitFormBoundaryReSsjbgq9JLAWEA8\nCookie: accessToken=eyJhbGciOiJIUzUxMiIsInR5cCI6IkpXVCJ9..qjyYZBEAv3NfWvAOWd0eSiZaDCf3fnRUq4-AaEKPBb7uu45dUFpzXni6hKxwlCebyIYuu_y1a9SI7Y51qzbFvA; refreshToken=7CC254C61CC47D95F42E85B92EF14756DF2301521DFD6E2A9B1A3C324F21F603\nOrigin: https://localhost:60769\nReferer: https://localhost:60769/\nContent-Length: 3473\nsec-ch-ua-platform: \"Windows\"\nsec-ch-ua: \"Google Chrome\";v=\"135\", \"Not-A.Brand\";v=\"8\", \"Chromium\";v=\"135\"\nDNT: 1\nsec-ch-ua-mobile: ?0\nsec-fetch-site: same-site\nsec-fetch-mode: cors\nsec-fetch-dest: empty\npriority: u=1, i\n', 'Content-Disposition: form-data; name=\"Cim\"\r\nValue: Oppenheimer\r\nContent-Disposition: form-data; name=\"Kategoria\"\r\nValue: 2D\r\nContent-Disposition: form-data; name=\"Mufaj\"\r\nValue:  Életrajzi, Dráma\r\nContent-Disposition: form-data; name=\"Korhatar\"\r\nValue: 16\r\nContent-Disposition: form-data; name=\"Jatekido\"\r\nValue: 181\r\nContent-Disposition: form-data; name=\"Gyarto\"\r\nValue: 	 Universal Pictures, Syncopy Inc., Atlas Entertainment, Gadget Films, Breakheart Films, Peters Creek Entertainment\r\nContent-Disposition: form-data; name=\"Rendezo\"\r\nValue:  Christopher Nolan\r\nContent-Disposition: form-data; name=\"Szereplok\"\r\nValue: Cillian Murphy, Emily Blunt, Matt Damon, Robert Downey, Jr., Florence Pugh, Benny Safdie, Michael Angarano, Josh Hartnett\r\nContent-Disposition: form-data; name=\"Leiras\"\r\nValue: A Christopher Nolan által írt és rendezett Oppenheimer egy IMAX-re forgatott nagyszabású thriller.  Berepíti a nézőt abba az izgalmas paradoxonba, amit az a rejtélyes férfi élt át, aki megkockáztatta, hogy elpusztítja a világot, azért, hogy megmentse azt. A főszereplők Cillian Murphy mint J. Robert Oppenheimer, és Emily Blunt mint a felesége, a biológus és botanikus Katherine “Kitty” Oppenheimer. Az Oscar-díjas Matt Damon alakítja Leslie Groves Jr. tábornokot, a Manhattan-terv igazgatóját, és Robert Downey, Jr. alakítja Lewis Strausst, az Amerikai Atomenergia Bizottság alapító biztosát. Az Oscar-jelölt Florence Pugh játssza Jean Tatlock pszichiátert, Benny Safdie Teller Ede elméleti fizikust, Michael Angarano Robert Serbert, valamint Josh Hartnett alakítja az úttörő amerikai atomtudóst, Ernest Lawrence-et. A szereplők közt találjuk még az Oscar-díjas Rami Malekot, és a rendező ismét együtt dolgozik a nyolcszoros Oscar-jelölt színésszel, íróval és rendezővel, Kenneth Branagh-gel. A film Kai Bird és a néhai Martin J. Sherwin Pulitzer-díjas könyve, az Amerikai Prométheus: J. Robert Oppenheimer diadala és tragédiája alapján készült. A producerek Emma Thomas, Charles Roven és Christopher Nolan. Nolan filmjei, köztük a Tenet, a Dunkirk, a Csillagok között, az Eredet és a Sötét Lovag-trilógia több mint ötmilliárd dollár bevételt hoztak világszerte, 11 Oscar-díjat és 36 jelölést gyűjtöttek be, köztük két a legjobb filmnek járó jelölést.\r\nContent-Disposition: form-data; name=\"EredetiNyelv\"\r\nValue: angol\r\nContent-Disposition: form-data; name=\"EredetiCim\"\r\nValue: Oppenheimer\r\nContent-Disposition: form-data; name=\"Szinkron\"\r\nValue: magyar\r\nContent-Disposition: form-data; name=\"TrailerLink\"\r\nValue: https://www.youtube.com/watch?v=1mR3r0JkJDI\r\nContent-Disposition: form-data; name=\"IMDB\"\r\nValue: 8.3\r\nContent-Disposition: form-data; name=\"Megjegyzes\"\r\nValue: \r\nContent-Disposition: form-data; name=\"imageId\"\r\nValue: 35\r\n', 'Content-Type: application/json; charset=utf-8\nContent-Length: 38\n', '{\"errorMessage\":\"Sikeres hozzáadás\"}', 200, '2025-04-08 19:46:11.443891'),
